// export default Home
import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/other-page">Other Page</Link>
          </li>
          {/* Add more navigation links as needed */}
        </ul>
      </nav>

      <img src="img/bulb.webp" width={1500} height={700} alt="Bulb"></img>
    </>
  );
}

export default Home;
